    [],nt"revision_timestamp": "2015-09-27T03:00:55.051447",nt"name": "2011-u-s-army-corps-of-engineers-usace-topographic-lidar-massachusetts-and-new-hampshirea6e82",nt"isopen":
    false,nt"url": null,nt"notes": "These files contain classified topographic
    and bathymetric lidar data as unclassified valid topographic data (1), valid topographic
    data classified as ground (2), noise (7), and valid bathymetric data (11). Classes
    1, 2 and 7 aredefined in accordance with the American Society for Photogrammetry
    and Remote Sensing (ASPRS) classification standards, while class 11 is specific
    to NOAA CSC. These data were collected by the Compact Hydrographic Airborne RapidTotal
    Survey (CHARTS) system along the coast of Massachusetts and New Hampshire. CHARTS
    integrates topographic and bathymetric lidar sensors, a digital camera and a hyperspectral
    imager on a single remote sensing platform for usein coastal mapping and charting
    activities. Data coverage generally extends along the coastline from the waterline
    inland 500 meters (topography) and offshore 1,000 meters or to laser extinction
    (bathymetry). Native lidar data isnot generally in a format accessible to most Geographic
    Information Systems (GIS). Specialized in-house and commercial software packages
    are used to process the native lidar data into 3-dimensional positions that can
    be importedinto GIS software for visualization and further analysis. Horizontal
    positions, provided in decimal degrees of latitude and longitude, are referenced
    to the North American Datum of 1983 (NAD83). Vertical positions are referencedto
    the NAD83 ellipsoid and provided in meters. The National Geodetic Survey's (NGS)
    GEOID03 model is used to transform the vertical positions from ellipsoid to orthometric
    heights referenced to the North American Vertical Datumof 1988 (NAVD88). The 3-D
    position data are sub-divided into a series of LAS files, each covering approximately
    5 kilometers of shoreline. The format of the file is LAS version 1.2.",nt"license_title":
